.hiddenclass {
  display: none;
}

#confetti {
  opacity: 0;
  position: fixed;
  left: 0;
  top: 0;
  -webkit-transition: all 5s;
  -o-transition: all 5s;
  transition: all 5s;
}

#confetti.opa {
  opacity: 100%;
}

.header {
  margin-top: 20px;
  width: 100%;
  opacity: 0;
  display: -webkit-box;
  display: -ms-flexbox;
  display: flex;
  -webkit-box-pack: justify;
  -ms-flex-pack: justify;
  justify-content: space-between;
}

.header.opac {
  opacity: 100%;
  -webkit-transition: all 1s;
  -o-transition: all 1s;
  transition: all 1s;
  -webkit-transition-delay: 0.5s;
  -o-transition-delay: 0.5s;
  transition-delay: 0.5s;
}


@-webkit-keyframes confetti-ani {
  0% {
    opacity: 0;
  }

  100% {
    opacity: 100%;
  }
}


@keyframes confetti-ani {
  0% {
    opacity: 0;
  }

  100% {
    opacity: 100%;
  }
}




strong {
  font-weight: 500;
}





a {
  text-decoration: none;
  color: black;
}

.page {
  margin-bottom: 0px;
  margin-top: 50px;
  width: 100%;
  position: relative;
  -webkit-transition: 1s all;
  -o-transition: 1s all;
  transition: 1s all;
  display: -webkit-box;
  display: -ms-flexbox;
  display: flex;
  -webkit-box-orient: vertical;
  -webkit-box-direction: normal;
  -ms-flex-direction: column;
  flex-direction: column;
  -webkit-transform: translateY(200px);
  -ms-transform: translateY(200px);
  transform: translateY(200px);
  opacity: 0%;
  -webkit-transition: all 0.4s ease;
  -o-transition: all 0.4s ease;
  transition: all 0.4s ease;
}

.page.move {
  -webkit-transform: translateY(0px);
  -ms-transform: translateY(0px);
  transform: translateY(0px);
  opacity: 100%;

}


.group {
  display: -webkit-box;
  display: -ms-flexbox;
  display: flex;
  -webkit-box-orient: vertical;
  -webkit-box-direction: normal;
  -ms-flex-direction: column;
  flex-direction: column;
  -webkit-box-align: center;
  -ms-flex-align: center;
  align-items: center;
}

.element {
  position: relative;
  -webkit-transition: 0.5s all;
  -o-transition: 0.5s all;
  transition: 0.5s all;
}

.hidden {
  display: none;
}

.message-block {
  line-height: 26px;
  position: relative;
  transition: 0.5s all;
  -webkit-transition: 0.5s all;
  -moz-transition: 0.5s all;
  -ms-transition: 0.5s all;
  -o-transition: 0.5s all;
}

.message-block-last {
  margin-bottom: 15px;
}

.right .message,
.left .message {
  position: relative;
  transition: 1s opacity, all 0.4s;
  -webkit-transition: 1s opacity, all 0.4s;
  -moz-transition: 1s opacity, all 0.4s;
  -ms-transition: 1s opacity, all 0.4s;
  -o-transition: 1s opacity, all 0.4s;
  opacity: 0;
}

@-webkit-keyframes bubbleleft {
  0% {
    opacity: 0;
    -webkit-transform: rotate(-45deg) scaleX(-1);
    transform: rotate(-45deg) scaleX(-1);
    left: -3.5px;
  }

  100% {
    opacity: 100%;
    -webkit-transform: rotate(0) scaleX(-1);
    transform: rotate(0) scaleX(-1);
  }
}

@keyframes bubbleleft {
  0% {
    opacity: 0;
    -webkit-transform: rotate(-45deg) scaleX(-1);
    transform: rotate(-45deg) scaleX(-1);
    left: -3.5px;
  }

  100% {
    opacity: 100%;
    -webkit-transform: rotate(0) scaleX(-1);
    transform: rotate(0) scaleX(-1);
  }
}

@-webkit-keyframes bubbleRight {
  0% {
    opacity: 0;
    -webkit-transform: rotate(45deg) scaleX(1);
    transform: rotate(45deg) scaleX(1);
    right: -4.5px;
  }

  100% {
    opacity: 100%;
    -webkit-transform: rotate(0) scaleX(1);
    transform: rotate(0) scaleX(1);
  }
}

@keyframes bubbleRight {
  0% {
    opacity: 0;
    -webkit-transform: rotate(45deg) scaleX(1);
    transform: rotate(45deg) scaleX(1);
    right: -4.5px;
  }

  100% {
    opacity: 100%;
    -webkit-transform: rotate(0) scaleX(1);
    transform: rotate(0) scaleX(1);
  }
}

.left>svg {
  position: absolute;
  left: -15.5px;
  bottom: -1px;
  -webkit-transform: rotate(-45deg) scaleX(-1);
  -ms-transform: rotate(-45deg) scaleX(-1);
  transform: rotate(-45deg) scaleX(-1);
  -webkit-animation: bubbleleft 0.6s;
  animation: bubbleleft 0.6s;
  -webkit-animation-fill-mode: forwards;
  animation-fill-mode: forwards;
  -webkit-animation-delay: 0.6s;
  animation-delay: 0.6s;
  fill: var(--left-svg-fill);
  opacity: 0;
}

.right>svg {
  position: absolute;
  right: -16.5px;
  bottom: -2px;
  -webkit-transform: rotate(45deg) scaleX(1);
  -ms-transform: rotate(45deg) scaleX(1);
  transform: rotate(45deg) scaleX(1);
  -webkit-animation: bubbleRight 0.6s;
  animation: bubbleRight 0.6s;
  -webkit-animation-fill-mode: forwards;
  animation-fill-mode: forwards;
  -webkit-animation-delay: 0.6s;
  animation-delay: 0.6s;
  fill: #0253e2;
  opacity: 0;
}

.message-block .show {
  opacity: 100%;
}

.right[data-emergence=hidden] .message {
  left: 500px;
}

.right[data-emergence=visible] .message {
  left: 0;
  opacity: 100%;
}

.left[data-emergence=hidden] .message {
  left: -500px;
}

.left[data-emergence=visible] .message {
  left: 0px;
  opacity: 100%;
}

.message-block {
  display: block;
  width: 100%;
  max-width: 675px;
  /* max-width: 860px; */
  margin-bottom: 10px;
}

.message {
  border-radius: 30px;
  display: inline-block;
  padding: 15px 25px;
  line-height: 34px;
  font-size: 24px;
}

.right .message {
  background-color: #0253e2;
  color: white;
  float: right;
}

.left .message {
  color: var(--left-message-color);
  background-color: var(--left-message-bg-color);
}


.button-group {
  display: -webkit-box;
  display: -ms-flexbox;
  display: flex;
  -webkit-box-pack: center;
  -ms-flex-pack: center;
  justify-content: center;
  margin-top: 75px;
  margin-bottom: 75px;
}


.btn {
  margin: 0 10px;
  background-color: transparent;
  padding: 10px 20px;
  border: var(--btn-border);
  -webkit-transition: 0.3s all;
  -o-transition: 0.3s all;
  transition: 0.3s all;
  font-size: 20px;
  color: var(--btn-text-color);
  border-radius: 50px;
}

.btn:hover {
  background-color: var(--btn-bg-color-hover);
  cursor: pointer;
}

.btn:focus {
  border-color: var(--border-color);
  outline: none;
}






.profile {
  z-index: 2;
  -webkit-transform: scale(0.5);
  -ms-transform: scale(0.5);
  transform: scale(0.5);
  opacity: 0%;
  margin-top: 25%;
  position: relative;
  display: block;
  margin-left: auto;
  margin-right: auto;
  height: 200px;
  width: 200px;
  -webkit-transition: all 0.4s ease;
  -o-transition: all 0.4s ease;
  transition: all 0.4s ease;
}

.profile.animate {
  -webkit-transform: scale(1);
  -ms-transform: scale(1);
  transform: scale(1);
  opacity: 100%;
}

.profile.animate.smaller {
  margin-top: 23px;
  position: relative;
  display: block;
  left: 2%;
  width: 90px;
  height: 90px;
}

#day {
  margin-top: 100px;
  color: var(--day-color);
  font-size: 16px;
  text-align: center;
  font-weight: 400;
  margin-bottom: 170px;
}

#currentTime {
  font-weight: 300;
}

#location {
  margin-top: 60px;
  color: var(--location-color);
  font-size: 14px;
  text-align: center;
  font-family: sans-serif;
  font-weight: 300;
}

.text-link-colors {
  color: var(--text-link-colors);
}

.light-text-link-colors {
  color: var(--text-link-colors);
  opacity: 0.5;
}

.showcase {
  /* left: 0 !important; */
  position: relative;
  display: -webkit-box;
  display: -ms-flexbox;
  display: flex;
}

.showcase-box {
  display: -webkit-box;
  display: -ms-flexbox;
  display: flex;
  -ms-flex-item-align: start;
  align-self: flex-start;
}


.box {
  position: relative;
  display: block;
  margin-right: 20px;
  margin-left: 20px;
  opacity: 0;
  -webkit-transition: all 0.5s;
  -o-transition: all 0.5s;
  transition: all 0.5s;
  -webkit-transform: translateY(50px);
  -ms-transform: translateY(50px);
  transform: translateY(50px);
}

.box.load {
  opacity: 100%;
  -webkit-transform: translateY(0);
  -ms-transform: translateY(0);
  transform: translateY(0);
}

.box.a {
  -webkit-transition-delay: 0.5s;
  -o-transition-delay: 0.5s;
  transition-delay: 0.5s;
  ;
}

.box.b {
  -webkit-transition-delay: 1.05s;
  -o-transition-delay: 1.05s;
  transition-delay: 1.05s;
  ;
}

.box.c {
  -webkit-transition-delay: 1.60s;
  -o-transition-delay: 1.60s;
  transition-delay: 1.60s;
  ;
}



.box img {
  -webkit-filter: brightness(100%);
  margin-top: 20px;
  cursor: pointer;
  max-width: 230px;
  /* 250 */
}


.box img:hover {
  -webkit-filter: brightness(70%);
  -webkit-transition: all 1s ease;
  -o-transition: all 1s ease;
  -webkit-transition: all 0.6s ease;
  -o-transition: all 0.6s ease;
  transition: all 0.6s ease;
}


.gallery-h {
  font-size: 21px;
  font-weight: 500;
  color: var(--text-link-colors);
  display: block;
  width: 150px;
  margin-bottom: 0px;

}

.gallery-h:hover {
  color: #B130FF;
  -webkit-transition: all 0.35s;
  -o-transition: all 0.35s;
  transition: all 0.35s;
}

.gallery-p {
  font-weight: 400;
  color: var(--text-link-colors);
  opacity: 0.5;
  margin-top: 3px;
  display: block;
  font-size: 16px;
  ;
}

.phone-link {
  text-decoration: underline;
  color: #007aff;
}

#pdf {
  text-decoration: underline;
  color: var(--border-color);
  cursor: pointer;
  line-height: 1;
  margin-left: auto;
  -webkit-transition: all 1s;
  -o-transition: all 1s;
  transition: all 1s;
}

#pdf::after {
  content: "ðŸ‘‰";
  font-size: 16px;
  opacity: 0;
}

#pdf2 {
  color: var(--border-color);
  cursor: pointer;
  line-height: 1;
  -webkit-transition: all 1s;
  -o-transition: all 1s;
  transition: all 1s;
  position: absolute;
}

#pdf2:hover {
  color: var(--day-color);
  -webkit-transform: translateX(25px);
  -ms-transform: translateX(25px);
  transform: translateX(25px);
}

#pdf:hover {
  color: var(--day-color);
}

#pdf2::before {
  content: "ðŸ‘‰";
  font-size: 16px;
  opacity: 0;
  -webkit-transform: scale(0);
  -ms-transform: scale(0);
  transform: scale(0);
  -webkit-transition: all 1s;
  -o-transition: all 1s;
  transition: all 1s;
}

#pdf2:hover::before {
  font-size: 16px;
  opacity: 100%;
  -webkit-transform: scale(1);
  -ms-transform: scale(1);
  transform: scale(1);
}

.skills {
  /*
  display: flex;
  flex-direction: row;
  align-items: left; */
